import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './components/Home';
import About from './components/Navigate';
import Contact from './components/Archive';

class App extends Component {
  render() {
    return (
    <Router>
        <div>
          <h2>Welcome to React Router Tutorial</h2>
          <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <ul className="navbar-nav mr-auto">
            <li><Link to={'/'} className="nav-link"> Home </Link></li>
            <li><Link to={'/archive'} className="nav-link">Archive</Link></li>
            <li><Link to={'/nav'} className="nav-link">Nav</Link></li>
          </ul>
          </nav>
          <hr />
          <Routes>
              <Route exact path='/' component={Home} />
              <Route path='/archive' component={Archive} />
              <Route path='/nav' component={Navigate} />
          </Routes>
        </div>
      </Router>
    );
  }
}

export default App;
